import React from 'react';
import "./style.scss";

import firstimg from   "../../images/Screen_Shot_2020_02_28_at_9.36.56_AM (2).jpg";
import secondimg from  "../../images/a78e92e2d7e2d7495b4e9acc5221c66a.jpg";

export default function About() {
    return (
        <div className="about">
            <section className="about-heading">
                About 
            </section>
            <div className="about-content">  
                <section className="about-info">
                    I am a third year university student pursuing Computer Science. 
                    I have keen interest in Machine Learning, and Web Development. <br/>  
                    Always on the lookout for opportunites to learn, improve and  
                    further build expertise in the field. 
                </section>
                <section className="about-image"></section>
            </div>
        
                
            
        </div>
    )
}
